                WriteLiteral(@"</p>
                <p style=""text-indent: 25px; text-align: justify;"">Оценка машин и оборудования может выполняться для определения стоимости  всего спектра объектов движимого имущества: станков, приборов,  технологических комплексов и поточных линий, силовых агрегатов, офисного  имущества, оргтехники, мебели, автомобилей, спецтехники, бытовых  предметов и прочих объектов.</p>
                <p style=""text-indent: 25px; text-align: justify;"">При проведении работы устанавливается  стоимость аналогичного оборудования, которое присутствует на рынке,  определяется износ и возможность получения доходов от использования или  продажи оцениваемого объекта. Окончательная величина стоимости  определяется на основании комплексного анализа перечисленных факторов.</p>
                <p style=""text-indent: 25px; text-align: justify;"">Оценка оборудования производится для  получения кредита, получения полной картины и возможной замены или  модернизации устаревшей техники, при лизинге, при страховании, при  купле-прода");
