                    <li>Год выпуска; </li>
                    <li>Технические характеристики объекта (мощность, масса,  размеры, производительность и т.п. – согласно технической документации); </li>
                    <li>Инвентарный номер, первичная и остаточная балансовая  стоимость на последнюю отчетную дату перед датой оценки (если  собственник объекта - юридическое лицо); </li>
